import React, { useState, useEffect } from "react";
import { Link, NavLink } from "react-router-dom";
import axios from "axios";
import NavDropdown from 'react-bootstrap/NavDropdown';
import { Navbar, Nav } from "react-bootstrap";
import Container from 'react-bootstrap/Container';
function UserProfile() {
  //   function logOut() {
  //     localStorage.clear();
  //     navigate('/');
  // }

  const [userInfo, setUserInfo] = useState({});
  useEffect(() => {
    const storedUserInfo = localStorage.getItem("user-info");

    if (storedUserInfo) {
      const parsedUserInfo = JSON.parse(storedUserInfo);
      setUserInfo(parsedUserInfo[0]);
    }
  }, []);
  const handleSubmit = (event) => {
    event.preventDefault();
  };

  return (
    <div >
      <Navbar  expand="lg" className="navbar navbar-dark bg-dark">
        <Container>
          <Navbar.Brand href="#home">Navigation</Navbar.Brand>
          <Navbar.Toggle aria-controls="basic-navbar-nav" />
          <Navbar.Collapse id="basic-navbar-nav">
            <Nav className="me-auto">
              
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
      <h3 className="d-flex justify-content-center align-items-center">User Profile</h3>
      {userInfo ? (
        <div className="username d-flex justify-content-center align-items-center 50-w vh-100 bg-white" action="" onSubmit={handleSubmit}>
          <table className=" justify-content-center ">
            <p className="">Name:</p> <p className=""> {userInfo.first_name}</p>
            <p className="d-flex ">Email: {userInfo.last_name}</p>
            <p className="d-flex ">Email: {userInfo.address}</p>
            <p className="d-flex ">Email: {userInfo.phone_Number}</p>
            <p className="d-flex ">Email: {userInfo.email}</p>
            <p className="d-flex ">Email: {userInfo.birthdate}</p>
          </table>
          
          {/* Display other user-specific data */}
        </div>
      ) : (
        <p>Loading user data...</p>
      )}
    </div>
  );
}

export default UserProfile;
